import React, { useEffect, useState } from "react";
import UserRegister from "../../components/User/UserRegister";
import UserRoleUpdate from "../../components/User/UserRoleUpdate";
import { Auth } from "../../auth";

export default function UsersPage() {
  const [users, setUsers] = useState([]);
  const [showRegister, setShowRegister] = useState(false);

  // Fetch all users
  const fetchUsers = () => {
    fetch("/api/users", {
      headers: { ...Auth.getAuthHeader() }
    })
      .then(res => {
        if (!res.ok) throw new Error("Unauthorized");
        return res.json();
      })
      .then(data => setUsers(Array.isArray(data) ? data : []))
      .catch(() => setUsers([]));
  };

  useEffect(() => {
    fetchUsers();
  }, []);

  // Delete user
  const handleDelete = async id => {
    try {
      await fetch(`/api/users/${id}`, {
        method: "DELETE",
        headers: { ...Auth.getAuthHeader() }
      });
      fetchUsers();
    } catch {
      alert("Failed to delete user.");
    }
  };

  // Show pending verifications
  const pending = users.filter(
    u => ["MANAGER", "STAFF", "SUPPLIER"].includes(u.role) && !u.verified
  );

  return (
    <div>
      <h2>User Management</h2>
      <nav style={{ marginBottom: 12 }}>
        <button onClick={fetchUsers}>View All Users</button>{" | "}
        <button onClick={() => setShowRegister(true)}>Register New User</button>
      </nav>

      {showRegister && (
        <UserRegister
          onSuccess={() => {
            setShowRegister(false);
            fetchUsers();
          }}
          onCancel={() => setShowRegister(false)}
        />
      )}

      <h3>All Users</h3>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th>
            <th>Role</th>
            <th>Verified</th>
            <th>Update Role</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {users.map(u => (
            <tr key={u.id}>
              <td>{u.name}</td>
              <td>{u.username}</td>
              <td>{u.email}</td>
              <td>{u.role}</td>
              <td>{u.verified ? "Yes" : "No"}</td>
              <td>
                <UserRoleUpdate userId={u.id} />
              </td>
              <td>
                <button onClick={() => handleDelete(u.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Pending Verifications</h3>
      {pending.length === 0 ? (
        <div>No pending verifications.</div>
      ) : (
        <ul>
          {pending.map(u => (
            <li key={u.id}>
              {u.name} ({u.role}) - {u.email}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
